const [data, setData]=useState("");

const getData=async()=>{
  const response=await Axios.get("http://localhost:8080/api/hello");
  setData(response.data);
}

useEffect(()=>{
  getData()

},[]);
return(
  <div>{data}</div>
)
}
export default App
